import React from 'react';
import '../styles/home.css';
import exercise from '../assests/exercise.jpg';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';
const Home = () => {
  return (
    <><AppBar position="static" color="default" elevation={1}>
          <Toolbar>
              <Typography variant="h6" sx={{ flexGrow: 1, color: 'black' }}>
                  Fitness Tracker
              </Typography>
              <Link to="/login" style={{ textDecoration: 'none' }}>
                  <Button color="primary" variant="outlined">Login</Button>
              </Link>
          </Toolbar>
      </AppBar>
      <div className="home-container">
              <div className="image-container">
                  <img src={exercise} alt="Exercise" />
              </div>
              <div className="text-container">
                  <h1>Fitness Tracker</h1>
                  <p>Welcome to Fitness Tracker</p>
                  <p>Track your progress, manage exercise plans, and collaborate with your trainer – all in one app. Whether you’re just starting out or a seasoned veteran, we’ve got you covered.</p>
                  <button>LOGIN</button>
                  <button>SIGN UP</button>
              </div>
          </div></>
  );
};

export default Home;
